export default function Front() {
  return (
    <section className="z-10">
      <div className="sm:w-11/12 mx-auto">
        {/* Container for the background image */}
        <div className="relative w-full aspect-[16/7] sm:rounded-3xl bg-homefrontbg bg-cover bg-center bg-no-repeat">
          {/* Aspect ratio ensures the container maintains a 16:9 ratio */}
        </div>
      </div>
    </section>
  );
}
